import React, { useEffect,setCount } from 'react';

const App = () => {

  useEffect(() => {
    const timer = setTimeout(() => {
      setCount('Timeout called!');
    }, 3000);
    return () => clearTimeout(timer);
  }, []);

  return (
    <div>
      <h1>Hello, World</h1>
    </div>
  );
};

export default App;
